window.bookSummaryJSON = "<p><b>Success can be dangerous.</b></p> <p>After surviving the depths of Castra's dungeon, Talyn has returned to the surface and caused a seismic change in the city, drawing the attention of those of great power. Now she has to deal with the consequences, for good and ill.</p> <p>As she attempts to find her place in Castra, Talyn's ability to maintain her independence is at risk, yet her previous life has taught her one thing for certain. She will not bow to anyone.</p>"; 
